INSERT INTO `questions` VALUES (1,'b91ee1e2-ff12-3359-96b7-cfc44587099c','1','The study of algae is called','{\"A\":\"Virology\",\"B\":\"Phycology\",\"C\":\"Bryology\",\"D\":\"Mycology\"}','Phycology','பாசிகளைப்  பற்றிய ஆய்வு ------------ என்று அழைக்கப்படுகிறது','{\"A\":\"\\u0bb5\\u0bc8\\u0bb0\\u0bbe\\u0bb2\\u0b9c\\u0bbf\",\"B\":\"\\u0b86\\u0bb2\\u0bcd\\u0b95\\u0bbe\\u0bb2\\u0b9c\\u0bbf\",\"C\":\"\\u0baa\\u0bbf\\u0bb0\\u0bc8\\u0bb2\\u0b9c\\u0bbf\",\"D\":\"\\u0bae\\u0bc8\\u0b95\\u0bbe\\u0bb2\\u0b9c\\u0bbf\"}','ஆல்காலஜி',1,'2023-10-10 09:53:34','2023-10-10 09:53:34'),(2,'ee5cd37e-0f05-3681-9847-5a915c7083ae','1','Plant body of algae is called ------','{\"A\":\"Thallus\",\"B\":\"Hyphae\",\"C\":\"Mycelia\",\"D\":\"Filament\"}','Thallus','ஆல்காவின் தாவர உடல் ---------- என்று அழைக்கப்படுகிறது','{\"A\":\"\\u0ba4\\u0bbe\\u0bb2\\u0bb8\\u0bcd\",\"B\":\"\\u0bb9\\u0bc8\\u0b83\\u0baa\\u0bc7\",\"C\":\"\\u0bae\\u0bc8\\u0b9a\\u0bc0\\u0bb2\\u0bbf\\u0baf\\u0bbe\",\"D\":\"\\u0baa\\u0bbe\\u0b9a\\u0bbf\"}','தாலஸ்',1,'2023-10-10 09:53:34','2023-10-10 09:53:34'),(3,'b1f2d8d5-fac5-3591-8378-45c237203fce','1','The system of naming the plants on a scientific basis is known as','{\"A\":\"Botanical Nomenclature\",\"B\":\"Binomial Nomenclature\",\"C\":\"Systematic Nomenclature\",\"D\":\"Classification\"}','Binomial Nomenclature','தாவரங்களுக்கு அறிவியல் அடிப்படையில் ---------------- பெயரிடும் முறை அறியப்படுகிறது','{\"A\":\"\\u0ba4\\u0bbe\\u0bb5\\u0bb0\\u0bb5\\u0bbf\\u0baf\\u0bb2\\u0bcd \\u0baa\\u0bc6\\u0baf\\u0bb0\\u0bbf\\u0b9f\\u0bb2\\u0bcd\",\"B\":\"\\u0baa\\u0bc8\\u0ba9\\u0bcb\\u0bae\\u0bbf\\u0baf\\u0bb2\\u0bcd \\u0baa\\u0bc6\\u0baf\\u0bb0\\u0bbf\\u0b9f\\u0bb2\\u0bcd \",\"C\":\"\\u0bae\\u0bc1\\u0bb1\\u0bc8\\u0baf\\u0bbe\\u0ba9 \\u0baa\\u0bc6\\u0baf\\u0bb0\\u0bbf\\u0b9f\\u0bb2\\u0bcd\",\"D\":\"\\u0baa\\u0bc6\\u0baf\\u0bb0\\u0bbf\\u0b9f\\u0bb2\\u0bcd\"}','பைனோமியல் பெயரிடல்',1,'2023-10-10 09:53:34','2023-10-10 09:53:34'),(4,'a37e4bdf-fa69-352b-be27-ac8104142b42','1','Binomial name was first introduced by Gaspard Bauhin in the year ----','{\"A\":\"1620\",\"B\":\"1623\",\"C\":\"1625\",\"D\":\"1624\"}','1623','பைனோமியல் பெயர் முதன்முதலில் காஸ்பார்ட் பௌஹின் என்பவரால் ----- ஆம் ஆண்டு அறிமுகப்படுத்தப்பட்டது','{\"A\":\"1620\",\"B\":\"1623\",\"C\":\"1625\",\"D\":\"1624\"}','1623',1,'2023-10-10 09:53:34','2023-10-10 09:53:34'),(5,'c57a8275-66a3-3cec-be9a-e40156f4679e','1','ICBN expand ----','{\"A\":\"International Code of Botanical Nomenclature\",\"B\":\"International Code of Binomial Nomenclature\",\"C\":\"International Code of Business Nomenclature\",\"D\":\"Indian code of Binomial Nomenclature\"}','International Code of Binomial Nomenclature','ICBN விரிவாக்கம் ----','{\"A\":\"\\u0ba4\\u0bbe\\u0bb5\\u0bb0\\u0bb5\\u0bbf\\u0baf\\u0bb2\\u0bcd \\u0baa\\u0bc6\\u0baf\\u0bb0\\u0bbf\\u0b9f\\u0bb2\\u0bbf\\u0ba9\\u0bcd \\u0b9a\\u0bb0\\u0bcd\\u0bb5\\u0ba4\\u0bc7\\u0b9a \\u0b95\\u0bc1\\u0bb1\\u0bbf\\u0baf\\u0bc0\\u0b9f\\u0bc1\",\"B\":\"\\u0baa\\u0bc8\\u0ba9\\u0bcb\\u0bae\\u0bbf\\u0baf\\u0bb2\\u0bcd \\u0baa\\u0bc6\\u0baf\\u0bb0\\u0bbf\\u0b9f\\u0bb2\\u0bcd \\u0b9a\\u0bb0\\u0bcd\\u0bb5\\u0ba4\\u0bc7\\u0b9a \\u0b95\\u0bc1\\u0bb1\\u0bbf\\u0baf\\u0bc0\\u0b9f\\u0bc1. \",\"C\":\"\\u0b9a\\u0bb0\\u0bcd\\u0bb5\\u0ba4\\u0bc7\\u0b9a \\u0bb5\\u0ba3\\u0bbf\\u0b95\\u0b95\\u0bcd \\u0b95\\u0bc1\\u0bb1\\u0bbf\\u0baf\\u0bc0\\u0b9f\\u0bc1.\",\"D\":\"\\u0b9a\\u0bb0\\u0bcd\\u0bb5\\u0ba4\\u0bc7\\u0b9a \\u0bb5\\u0ba3\\u0bbf\\u0b95\\u0b95\\u0bcd \\u0ba4\\u0bbe\\u0bb5\\u0bb0\\u0bb5\\u0bbf\\u0baf\\u0bb2\\u0bcd \\u0b95\\u0bc1\\u0bb1\\u0bbf\\u0baf\\u0bc0\\u0b9f\\u0bc1.\"}','பைனோமியல் பெயரிடல் சர்வதேச குறியீடு.',1,'2023-10-10 09:53:34','2023-10-10 09:53:34'),(6,'b72ab56d-aa77-36fd-9233-311d7d5d75b8','1','The binomial name of mango is Mangifera indica. Here the first word Mangifera refers to the -------------- name','{\"A\":\"Species\",\"B\":\"Genus\",\"C\":\"Generic\",\"D\":\"Specific\"}','Genus','மாம்பழத்தின் இருசொல் பெயர்  மாங்கிஃபெரா இண்டிகா. இங்கே முதல் வார்த்தை மாங்கிஃபெரா --------------- பெயரைக் குறிக்கிறது','{\"A\":\"\\u0b87\\u0ba9\\u0b99\\u0bcd\\u0b95\\u0bb3\\u0bcd\",\"B\":\"\\u0b9c\\u0bc6\\u0ba9\\u0bb8\\u0bcd\",\"C\":\"\\u0baa\\u0bc6\\u0bbe\\u0ba4\\u0bc1\\u0bb5\\u0bbe\\u0ba9\",\"D\":\"\\u0b85\\u0b9a\\u0bbe\\u0ba4\\u0bbe\\u0bb0\\u0ba3\\u0bae\\u0bbe\\u0ba9\"}','ஜெனஸ்',1,'2023-10-10 09:53:34','2023-10-10 09:53:34'),(7,'da207b42-ee4c-379c-b4ae-f9274d5055b6','1','Penicillin antibiotic is obtained from','{\"A\":\"Algae\",\"B\":\"Fungi\",\"C\":\"Pteridophytes\",\"D\":\"Bryophytes\"}','Fungi','பென்சிலின் ஆண்டிபயாடிக் --------------- லிருந்து பெறப்படுகிறது','{\"A\":\"\\u0baa\\u0bbe\\u0b9a\\u0bbf\",\"B\":\"\\u0baa\\u0bc2\\u0b9e\\u0bcd\\u0b9a\\u0bc8\",\"C\":\"\\u0bb8\\u0bcd\\u0b9f\\u0bc6\\u0bb0\\u0bbf\\u0b9f\\u0bcb\\u0b83\\u0baa\\u0bc8\\u0b9f\\u0bcd\\u0bb8\\u0bcd\",\"D\":\"\\u0baa\\u0bbf\\u0bb3\\u0bbe\\u0bb8\\u0bcd\\u0bae\\u0bbe\"}','பூஞ்சை',1,'2023-10-10 09:53:34','2023-10-10 09:53:34'),(8,'c323481c-88e3-3b4e-aa87-62f94398524f','1','Ephedrine cures ----','{\"A\":\"Allergy\",\"B\":\"Asthma\",\"C\":\"Skin disease\",\"D\":\"Ring worm\"}','Asthma','எபெட்ரின் -------------யை குணப்படுத்துகிறது','{\"A\":\"\\u0b92\\u0bb5\\u0bcd\\u0bb5\\u0bbe\\u0bae\\u0bc8\",\"B\":\"\\u0b86\\u0bb8\\u0bcd\\u0ba4\\u0bc1\\u0bae\\u0bbe\",\"C\":\"\\u0ba4\\u0bcb\\u0bb2\\u0bcd \\u0ba8\\u0bcb\\u0baf\\u0bcd\",\"D\":\"\\u0bae\\u0b9e\\u0bcd\\u0b9a\\u0bb3\\u0bcd \\u0b95\\u0bbe\\u0bae\\u0bbe\\u0bb2\\u0bc8\"}','ஆஸ்துமா',1,'2023-10-10 09:53:34','2023-10-10 09:53:34'),(9,'861935ea-635a-3736-85c6-231f1ec80dba','1','The common name of Mangifera indica is ------','{\"A\":\"Mango\",\"B\":\"Hibiscus\",\"C\":\"Musambi\",\"D\":\"Mulberry\"}','Mango','மங்கிஃபெரா இண்டிகாவின் பொதுவான பெயர் --------','{\"A\":\"\\u0bae\\u0bbe\\u0bae\\u0bcd\\u0baa\\u0bb4\\u0bae\\u0bcd\",\"B\":\"\\u0b9a\\u0bc6\\u0bae\\u0bcd\\u0baa\\u0bb0\\u0bc1\\u0ba4\\u0bcd\\u0ba4\\u0bbf\",\"C\":\"\\u0bae\\u0bc1\\u0b9a\\u0bbe\\u0bae\\u0bcd\\u0baa\\u0bbf\",\"D\":\"\\u0bb5\\u0bbe\\u0bb4\\u0bc8\"}','மாம்பழம்',1,'2023-10-10 09:53:34','2023-10-10 09:53:34'),